import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS

function Contact() {
    return (
      <div>
        <h2>Contact Us</h2>

        {/* Contact Form */}
        <form>
          {/* Form fields go here */}
        </form>

        {/* Contact Information */}
        <div>
          <p>Email: your@email.com</p>
          <p>Phone: (123) 456-7890</p>
        </div>

        {/* Location/Address */}
        <div>
          <p>123 Main Street, Cityville, State 12345</p>
        </div>

        {/* Map */}
        {/* You can embed a map here if needed */}

        {/* Business Hours */}
        <div>
          <p>Business Hours: Monday-Friday, 9:00 AM - 5:00 PM</p>
        </div>

        {/* Call to Action */}
        <p>Feel free to reach out for any inquiries or just to say hello!</p>
      </div>
    );
  }


export default Contact;
